INSERT INTO [[schema]].psea_indicator VALUES (1, '2019-10-04 17:29:37.7+00', '2020-01-17 15:56:49.785+00', 'Core Standard 1: Organizational Policy', 'Refer: <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank"> PSEA Toolkit</a> Section 4.2.1. Policies.<br> <b>Required 1:</b> An organizational policy on PSEA exists and describes appropriate standards of conduct, other preventive measures, reporting, monitoring, investigation and corrective measures.<br>(UN IP Protocol para 15 & Annex A.4)', true, 1, '');
INSERT INTO [[schema]].psea_indicator VALUES (2, '2019-10-04 17:29:37.734+00', '2020-01-17 16:18:50.755+00', 'Core Standard 2: Organizational Management and HR Systems', 'Refer: <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank">PSEA Toolkit</a> Section 4.2.2. Procedures
<b>Required 1:</b> The organization’s contracts and partnership agreements include a standard clause requiring contractors, suppliers, consultants and sub-partners to commit to a zero-tolerance policy on SEA and to take measures to prevent and respond to SEA.
<b>Required 2:</b> There is a systematic vetting procedure in place for job candidates (e.g. reference checks, police records, Google searches) in accordance with local laws regarding employment, privacy and data protection, including checking for prior involvement in SEA.
(UN IP Protocol para 11; 15; & Annex A.1, A.2)', true, 2, '');
INSERT INTO [[schema]].psea_indicator VALUES (3, '2019-10-04 17:29:37.765+00', '2020-01-17 16:09:07.966+00', 'Core Standard 3: Mandatory Training', 'Refer <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank">PSEA Toolkit</a> Section 4.3.1. Training
<b>Required 1:</b> The organization holds mandatory trainings for all personnel on the organization’s SEA policy and procedures and the training includes 1) a definition of SEA (that is aligned with the <a href="https://undocs.org/ST/SGB/2003/13" target="_blank">UN''s definition</a>); 2) a prohibition of SEA; and 3) actions that personnel are required to take (i.e. prompt reporting of allegations and referral of survivors).
(UN IP Protocol para 17 & Annex A.5)', true, 3, '');
INSERT INTO [[schema]].psea_indicator VALUES (4, '2019-10-04 17:29:37.795+00', '2020-01-17 16:13:32.26+00', 'Core Standard 4: Reporting', 'Refer <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank">PSEA Toolkit</a> Section 4.3.2. Awareness-raising and Section 5.2. Reporting Mechanisms
<b>Required 1:</b> The organization has mechanisms and procedures for personnel, beneficiaries and communities, including children, to report SEA allegations that comply with core standards for reporting (i.e. safety, confidentiality, transparency, accessibility) and ensures that beneficiaries are aware of these.<br>(UN IP Protocol para 19 & Annex A.3)', true, 4, '');
INSERT INTO [[schema]].psea_indicator VALUES (5, '2019-10-04 17:29:37.826+00', '2020-01-17 16:17:14.743+00', 'Core Standard 5: Assistance and Referrals', 'Refer <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank">PSEA Toolkit</a> Section 6.2. Assistance and Referrals
<b>Required 1:</b>The organization has a system to ensure survivors of SEA, including children, receive immediate professional assistance, referring them to qualified service providers.<br> (UN IP Protocol para 22.d.)', true, 5, '');
INSERT INTO [[schema]].psea_indicator VALUES (6, '2019-10-04 17:29:37.857+00', '2020-01-17 16:18:03.295+00', 'Core Standard 6: Investigations', 'Refer <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B765CA079-24EE-430C-938B-A9AE3C6A33EB%7D&file=PSEA%20Toolkit%20Jan%206%202020.docx&action=default&mobileredirect=true&cid=e14f47f7-2758-4a39-bab8-865fdf886e18" target="_blank">PSEA Toolkit</a> Section 7.2. Investigation Procedures).
<b>Required 1:</b> The organization has a process for investigation of allegations of SEA and can provide evidence that it has appropriately dealt with past SEA allegations, if any, through investigation and corrective action.
(UN IP Protocol para 20, 22.a., & Annex A.6)', true, 6, '');


