INSERT INTO [[schema]].t2f_travel VALUES (681, '2020-11-17 13:08:07.957426+00', NULL, NULL, NULL, NULL, NULL, '', '', '', '16th November 2020

Directorate of Policy Planning and Information, Ministry of Health and Sanitation.
M&E Specialist, HMIS Manager, HMIS Officer.

United Nations Children’s Fund
M&E Consultant

Partners in Health
eHealth Manager, eHealth Specialist		

Report of the joint field visit by UNICEF M&E Consultant and members of the Directorate of Policy Planning and Information (DPPI), Ministry of Health and Sanitation to Wellbody Clinic, Kono on 12th-14th November 2020. 


Introduction:
1.	A field visit comprising an M&E Consultant from UNICEF and three representatives from the Ministry of Health and Sanitation (MOHS) was led by Dr Edward Magbity, M&E Specialist, Directorate of Policy Planning and Information (DPPI) and Nathaniel Suluku, UNICEF M&E Consultant to the Wellbody Clinic in Kono from 12th – 14th November 2020. 

2.	The purpose of the visit was to learn the implementation project of an Electronic Medical Records (EMR) systems developed by Partners in Health at the Wellbody Clinic in Kono. More specifically, to know how the EMR function under real-world conditions and to understand the ways the EMR works, plans and challenges.

3.	The visit also allowed the delegation to see how an EMR system truly fit into the Wellbody clinic and how it has improved patient care and operations. The visit provided an opportunity for the team to better understand the challenges facing by Partners-in-Health, end-users and the beneficiaries.


4.	I would like to thank the leadership of UNICEF Sierra Leone for the well-prepared and well-organized visit; a thanks to Partners-in-Health for their hospitality and availability for taking us through the EMR and knowledge sharing, a special thanks to the Ministry of Health and Sanitation for being part of the delegation visit.







The programme of the visit consisted of two main components:

1.	Tour of the EMR workflow in the different units of the Wellbody clinic, UNICEF M&E Consultant; MOHS Team, PIH team, beneficiaries. 
2.	Presentation of the EMR planning/challenges, UNICEF M&E Consultant, MOHS team, PIH team.
3.	This report summarizes the information received by the M&E Consultant and concludes with observations.
Background

Wellbody clinic was founded by a non-governmental healthcare organization called the Wellbody Alliance in 2006. The specific aim was to treat amputees and civilians wounded during Sierra Leone’s civil war in Kono district. However, services of the clinic were later extended to the entire populace of Kono district and the environ.   
In 2014, PIH formed a partnership with Wellbody Alliance and works at the Wellbody Clinic. 
The Wellbody clinic is in Dorma, a village in Kono just outside of the city of Koidu. 
The volume of patients being seen at the clinic daily is 250 on average. 
The services provided include Primary Care, Maternity/Deliver/Antenatal Care, HIV, TB and others.

Tour of the EMR workflow in the different units of the Wellbody clinic

Phase 1 of the current EMR was implemented in June 2016 by Partners-in-Health at the Wellbody Clinic in Kono, Sierra Leone.
As a “Point of Care” system, the EMR system allows physicians and medical staff to accurately achieve real-time, patient biodata, medical history, lab-quality diagnostic results within minutes. It provides a direct entry and use of data, immediate access to the latest data, provide alerts to clinicians and staff and improves data quality.

Wellbody Clinic EMR Implementation timeline
 
•	Registration and Check-in [ 9 June 2016]
•	Pre-Implementation [1 Nov - 29 Nov]: Preparation before Rollout
•	Go Live Phase 1 [2 Dec - 20 Dec]: OPD (Initial, Follow Up), Triage
•	Go Live Phase 2 [2 Jan - 31 Jan]: Med Order, ANC Reg, Pharmacy (Viewing order) 
•	Go Live Phase 3 [3 Feb - 21 Feb]: ANC Visits, Pharma (Dispensing)
•	Go Live Phase 4 [24 Feb - 13 Mar]: Lab Order/Results

Waiting Hall:
At the waiting hall, all patients are screened for covid-19 sings using a commcare application. The application is installed on a tablet. After screening, the patients are sent to the registration unit. 

Registration unit
The first rollout at the wellbody clinic only captures patient registration module.
At the registration unit, each new patient is being registered on the system and issued a plastic ID card generated out of the EMR. Returning patients bring their cards back which are scanned into the system to identify them. The reason for visit information is captured for all patients receiving care. Reports can be produced with detailed address and other demographic information for all patients and reasons for every visit.
During the rollout, the registration staff and the clinic leadership were trained on the registration functions and given a preview of some of the completed clinical functions.  

Triage
At the triage, all patient vitals are captured and recorded in the EMR by well trained nurses.

Key findings 

Sustainability
For any system to be effective and efficient, sustainability is key. I spoke with key stakeholders on how they think the current system will be sustained. Below were answers I got from them.
Sustainability of the Network and software infrastructure are:
•	Monthly budget allocation for procurement of ICT materials (papers, printers, laminating cards etc.)
•	Monthly software/network system maintenance and continuous monitoring of quality and knowledge management. 
•	Continuous internal training and workshops of clinical and non-clinical staff on the EMR usage
•	Continuous quality assessment with feedback to developers on what is working best and what is not working well.

Security
It was observed that the current EMR is running on a Linux Operating system. Linux offers a top-notch interface, built-in security. 
Physically, the servers and witches are well placed in a sever room which has lock and only authorized personnel are allowed.

Network layout
According to the head of the IT unit, the network layout in the entire facility is a star topology network, with three servers (Live, backup, and a cloud backup server).
There are three management switches which are installed in different locations in the facility.

Electricity supply
There is a plant generator that provides electricity.

Working approach 
The delegation appreciated that there are strong and direct links between work at the management level and operational activities in all units visited.  
 
The delegation was very impressed by the level of participation of beneficiaries. 
The delegation noticed the high level of ownership by the community.

Lessons learnt, main recommendations, suggestions and challenges 

I learnt that there was an excellent collaboration and committed spirit of PIH staff using the EMR. All units using the EMR system gave an overall very good impression to the delegation of functioning very well as a team, proper synergy with clear strategic vision, goal, a high level of willingness to do more together.  

I was interested to further identify the success factors, and bottlenecks in implementing the EMR
The success factors they said were:
•	A Specific, Measurable, Achievable, Realistic, and Timely goals pave the way for success
•	Wiliness by clinical and non-clinical staff to accept the system
•	Teamwork and excellent communication skills
•	Management and stakeholders support
•	Community and staff ownership

Throughout the visit, there was clear evidence of positive change in the time patients spent in the clinic. This is as a result of the unique and innovative approaches of PIH in implementation EMR system.

Our interactions with beneficiaries/caregivers were very valuable and gave us a clear insight into the development that is currently going on. 

EMR Resources 
-	IT equipment
-	EMR instance
-	3 servers (active, passive, dev)
-	Laptops, printers, scanners
-	PACS system if radiology system is chosen
-	Team of developpers
-	Business Analyst
-	Project Manager

A final demo of the EMR was done by the eHealth specialist to the delegation. 

On behalf of the delegation, I would like to express my gratitude to the PIH team for their hospitality and availability for taking us through the EMR system. A special appreciation is also extended to UNICEF-Sierra Leone for the extremely well-prepared and organized joint field visit, as well as to the Health and Nutrition unit for their support and the Ministry of Health and sanitation Team. Special thanks are extended to PIH eHealth Manager and eHealth Specialist for coordinating the joint field visit. 


Action Points
•	UNICEF to work with MOHS and PIH to use an updated International Classification of Disease (ICD) coding system for the proposed EMR.
•	The delegation recommended for session to be organize for clinicians on how they should diagnose and input the diagnose result into the EMR system.
•	There should be a session also on drug prescription.
•	MOHS, UNICEF and PIH to agree on the rollout of the EMR system 
•	UNICEF and management of ODCH should finalise whether to use tablet or computers for the EMR in wards.
•	Procurement of EMR tools, materials (servers, switches, ID card printers, laminating cards, computers/tablets)
•	Training of end users and other major stakeholders on the EMR use', '', 'planned', '2020-11-12', '2020-11-14', 'To learn the implementation project of an Electronic Medical Records (EMR) systems developed by PIH in Kono', '', false, false, '2020/663', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 335407, NULL, NULL, 3);
