INSERT INTO [[schema]].t2f_travel VALUES (685, '2021-02-07 05:01:52.774719+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Report on Field Monitoring 
CP Facilities Field Monitoring during covid-19, February 2021 

Name of IP: Save the Children
Center type: Multipurpose Centre 
Total center: 1
Location type: Camp 10,Block:G10 

Observation: 
MPC was functional with few caregiver women attending the awareness session on Covid-19, Child Protection Issues. The MPC has 2 volunteer and 2 facilitators. In January they started working in the new phase. In weekly basis, they are conducting home based session and small session at the MPC discussing about life skills, different recreational activities.
Child Protection concern: 
Girls are getting married frequently and the increase in child marriage is visible. Domestic abuse and harassment have increased since Covid-19 struck. 

Challenges: 
•	At present SCI is only going forward with non-financial activities, once all the monetary formalities are completed, they will start activities which will require budget related activities such as training for the trainers on life skill, CBCPC members, caregiver.', '', 'planned', '2021-02-02', '2021-02-02', 'Routine Child Protection Facility Monitoring at the Camp 10 and 11.', 'Caregiver women are getting session on Covid-19 awareness ,Child Protection issues.', false, false, '2021/667', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 337396, NULL, NULL, 5);
INSERT INTO [[schema]].t2f_travel VALUES (688, '2021-03-11 06:41:55.516572+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Bien que l’atteinte de résultats reste plus ou moins acceptable, la mise en œuvre des activités du projet en harmonie avec la FT reste très mitigeur.
-	Le décaissement de fonds, très probablement en retard, a beaucoup impacté sur la mise en œuvre du projet ; surtout au niveau de la chaine d’approvisionnement et la mise en œuvre des activités au niveau de FOSA et dans la communauté.
-	Bien que décaissé aussi avec un grand retard, en décembre 2020, les fonds ont été aussi partiellement décaissés de la DPS vers les ZS mais aussi des ZS vers les structures de santé impactant aussi sur la qualité et le niveau de mise en ouvre des activités sur terrain.
-	La ZS et les structures de santé n’ayant pas bénéficié d’appui suffisant (supervision et suivi) du PEV (pour la ZS) mais aussi le suivi des activités par la ZS vers les aires de santé, la qualité de l’offre de service n’a pas été assuré aux points de prestation (FOSA) : Non maitrise des enfants non complètement vaccines, du respect de la chaine de froid au cours du processus de transport de vaccins, rupture de certains antigènes, chaine de froids non disponible au niveau du bureau central de la ZS, etc.', '', 'planned', '2021-01-07', '2021-01-10', 'Visit programmatique', 'RAS', false, false, '2021/670', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 338042, NULL, NULL, 3);
