INSERT INTO [[schema]].t2f_travel VALUES (686, '2021-02-19 07:14:05.974186+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Progress on Activities and/or Outputs (insert pictures, tables, or links if necessary)

In 2020, UNICEF provided supports to health facilities for emergency preparedness and response to COVID-19 at subnational level, including for continuity of primary health services in 2020 include several activities that include:
•	Development of guidelines in response to COVID-19
•	Implementation of guidelines in response to COVID-19
•	Development of storyboard in response to COVID-19
•	Support to mental health at hospital in response to COVId-19.

There were two activities that were implemented including:
1)	Development of NSPK in response to COVID-19, particularly for the meeting to develop guidelines in COVID-19 response at referral health facilities, with 58,950,000 IDR of expenditure. The activities took place on 11, 12 and 16 November 2020. The aimed was to develop and finalise draft of guideline for referral health facilities in response to COVID-19. 

I participated the meeting on 11 November 2020 in development of draft that was discussed through webinar. Some participants participated remotely and others joined in the meeting room where the meeting was held by the Ministry of Health (MoH) Referrral Health Facility Directorate. Some of the outputs include:
•	Draft Technical Guideline for health facility services in the new adaptation of COVID-19
•	Draft Guidelines to Ambulance
•	Draft Guideline to Public Safety Center (PSC).

The guidelines for Draft Technical Guideline for health facility services in the new adaptation of COVID-19 was later being finalised and disseminated to a national website through the following link:
https://covid19.go.id/edukasi/masyarakat-umum/panduan-teknis-pelayanan-rumah-sakit-pada-masa-adaptasi-kebiasaan-baru

Another technical guideline that was being developed that include MoH Referral Health Facility directorate can be accessed in the following link:
https://covid19.go.id/edukasi/tenaga-kesehatan/pelayanan-kesehatan-puskesmas-di-masa-pandemi-covid-19

 

2)	Implementation of guideline in response to COVID-19, particularly for technical support in management of COVID-19, with 29,972,000 IDR of expenditure. The location took place in Jakarta, Bogor, Depok and Bekasi with the following timelines: 23 October (Jakarta), 26-27 October and 2-3 November (Bekasi), 26-27 October and 2-3 November (Depok) and 3-5 November 2020 (Bogor). MoH conducted field visits to hospitals in those venue and has done mapping on hospital preparedness in management of influx of COVID-19 patients. Follow up that was felt necessary after that visit include socialisation of the findings in zoom meeting and technical support to build capacity of health facilities.', '', 'planned', '2020-11-02', '2020-12-31', 'To participate and to monitor development of guideline for health services in response to COVID-19 pandemic.', 'All action points have been done, including completion of FACE DCT, refund to UNICEF account and revision of the reports to include list of participants and agenda of the meetings.', false, false, '2021/668', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 177090, NULL, NULL, 8);
INSERT INTO [[schema]].t2f_travel VALUES (697, '2021-06-14 11:37:31.119601+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Water Supply
Nankumi
•	We verified 8 water points, of which 4 manual pumps in operation, of these, 2 were built by Helvetas and SDPI. The other 4 Sources are solar panel water supply systems (5000 liters/Tank) built by UNDP and have not yet been inaugurated for use.
Nanjua B (Marocane)
•	We checked 8 water sources, of which 5 solar panel systems only 1 functional, and 2 hand pumps also in operation. The 5 systems, 4 were financed by UNDP and 1 by Helvetas, which is in the initial stage of construction, but the hole has already been drilled.
Nanona (Caricari)
•	We verified 4 water points, of which 1 functional Manual pump made by UNICEF, 3 Solar panel systems, of these, 2 made by UNDP waiting for the inauguration since the IDPs have not yet received plotes, and 1 system from Helvetas under construction.
Cujupani
•	We checked only one source of operational water that was built by UNICEF.
Sanitation / Hygiene 
Cujupani
•	10 emergency latrines have already been built in the ratio of 5 blocks (each block has 2 bathrooms and two male and female latrines), and 10 plastic slabs have been delivered to complete the other 10 latrines to receive 970 displaced families who are currently in the host communities.
Nanjua A
•	4 latrines were burned by the community due to the misunderstanding of the humanitarian assistance approach by the partners’ vs coronavirus and Cholera disease. In this context, Helvetas delivered 4 plastic slabs for the reconstruction of emergency latrines.

Nanjua B (Marocane)
•	858 concrete slabs were manufactured, of which 751 slabs were already distributed to families, 14 slabs for public areas, 42 slabs were broken and 51 remained to be distributed;
NFI
•	Dignity Kits (1 bucket, Panties, Capulana, dressing) and Hygiene Kits (Soap, brush, colgate and flashlight) were distributed for 951 HH.
Nankumi
•	For this Resettlement site Helvetas does not have Sanitation and Hygiene activities, being the responsibility of the ISAC partner.', '', 'planned', '2021-05-18', '2021-05-18', 'To Monitor existing and new water sources as well as emergency latrines and the distribution of done slabs', '', false, false, '2021/679', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 352048, NULL, NULL, 1);
