INSERT INTO [[schema]].t2f_travel VALUES (699, '2021-06-29 02:10:17.70543+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'TRIP REPORT
Reporting may be completed while in the field or at the office. All trip reports have to be completed and submitted 14 days after the trip is completed.

A.	Travel Details 
TA number:    0001909951, 0001909952
Travel destination/s:   Wenxian County, Henan Province                                                           	
Staff member: Hongfeng NIU, Xiaona Huang
Date/s of travel: Jun 24- Jun 25,2021

B.	Type of travel and purpose 
Type of travel1: tick as many as are applicable
HACT Assurance:   
Description of purpose:
Field visit of IMCHD- ECD program and observation of the filed data collection of formative eval[[schema]]ion in Wen County, Henan Province.

C.	Reporting 
Key people met: 
•	Mr. Wu Long of MCH Department of NHC 
•	Ms. Zhang Wei of NCWCH
•	Pro. Zhou Hong, Pro Liu Shuang, Pro. He Hong, and other quantitative and qualitative eval[[schema]]ion team members
•	Wang Chunhui, Deputy Division Director of Henan Provincial Health Commission; Chen Wei, Programme Manager to ECD programme of Henan Province; Local governors of Wen County, as well as ECD programme managers and service providers from county, township and village levels   

Summary of mission: (Descriptive summary of no more than 200 words as per the described purpose in Section B. If this is a HACT assurance trip report – please include information on WBS)

This two days’ mission was conducted jointly by child division of NHC, NCWCH and UNICEF.  The mission improved the mutual understanding and help achieving alignment in further program cooperation.

Intended objectives		Activities towards meeting the objectives 
1.	To enable two newly onboard officers from NHC and UNICEF to have the better understanding of the IMCHD- ECD program’s implementation in the field	•	Attended the program review meeting hosted by Wen county with local governor, Health Commission and relevant departments’ participation
•	Field visit to Cangtou village and Dongnanleng village to learn the implementation of care-group activities and home visiting work 
•	Filed visit to Wen county MCH hospital 
2.	To observe the implementation and quality of IMCHD-ECD eval[[schema]]ion 	•	Observed quantitative survey to household with developed questionnaire conducted by local trained investigators and supervised by Zhou Hong and team
•	Observed qualitative interview for beneficiary groups (caregivers of children under 3, and village doctors) conducted by Liu Shuang and her team  

C.  Constraints/Challenges/Opportunities:
(Related to the overall project implementation and achievement of results):
Constraints/Challenges: please indicate any red flags, including if in areas affecting other programmes or 

•	The new cycle ECD program is being negotiated with NHC to reach alignment on the scaling up plan as well as programme scopes. The filed visiting provided good opportunity to solicit the comments from provinces on the potential strategies and requirements of scaling up, e.g. the pathway and the possibility to integrate ECD service into national Basic Public Health Service was discussed. 

Basically, the ECD programme is welcome by local government, service providers and families, and they hope the program can continue and scale up. The parents and caregivers universally feedback that the care-group activities and home visiting conducted by village doctors benefited families on nurturing care of their children. Some MCH service providers gave suggestions on improvement of program, for example, the ECD counselling card is suggested to reduce the text and add more interesting pictures. The cost of the care-group activity is calculated with information provided for NCWCH reference when revising the proposal.  

Regarding the financial mechanism on care group activities and home visiting, local government prefers having the subsidies independent to the 12 traditional components of  PHC package. They concerned the subsidies will be diluted if mixed with other components. 

Another key point was on the possible HR resource for care group activities and home visiting. For home visiting, village doctors felt that they can handle it as they also do regular home visiting for other services. For care group, there were different mechanisms, e.g. village doctor alone, or village doctor + teacher of  Kindergarten. However, the feedback from different levels reached consensus that it needs HR resource in addition to village doctor if for quality implementation.

•	The eval[[schema]]ion of the IMCHD-ECD program was finally initiated in June after great efforts in pushing forward. All the data collection are anticipated to be completed by the end of July. Through observation of the quantitative survey and qualitative interview conducted in Wen County, the data collection  was implemented as designed in inception report, including the training conducted for local investigators,  ethical procedure strictly followed, independent interviewing, and so on. It was also observed that the local investigators demonstrated well understanding of questions in the questionnaire. Qualitative experts were professional in structure interviewing. The overall quality was assured.

D. Action points (only actionable recommendations. Overarching observations can be included under ‘summary of mission’).
What 	By when (mm/yy)	By whom 
1.	Discuss with NHC/NCWCH on new cycle program workplan 	July 2021	Xiaona Huang, Hongfeng NIU
2.	Follow up on the progress of  the field data collection of eval[[schema]]ion in Guizhou and Jiangxi 	July 2021 	Hongfeng NIU
		
E.	Trip Report Submission and Review 
Date of submission: 2021-6-28
Submitted to: Xiaona Huang

Date of Review:  2021-6-28
Comments from supervisor: Xiaona Huang

F.	Attachments (if any)', '', 'planned', '2021-06-24', '2021-06-25', 'Field visit of IMCHD- ECD program and observation of the filed data collection of formative eval[[schema]]ion in Wen County', '', false, false, '2021/681', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 358050, NULL, NULL, 8);
