INSERT INTO [[schema]].t2f_travel VALUES (717, '2021-08-31 05:51:56.998209+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'A virtual programmatic visit to RSPN''s project district Rawalpindi, Punjab, Pakistan, to monitor UNICEF supported activities for building awareness and helping communities understand and adopt preventive measures to control the spread of Covid-19. The virtual monitoring was conducted on 26 May 2021 via Zoom as there was complete ban on travel due to Covid-19 restrictions. I interacted with five key persons including Project Manager, District Project Officer, M&E Officer and two Social Mobilizers and discussed project implementation, different activities, challenges and solutions and opportunities. Complete report is attached.', '', 'planned', '2021-05-26', '2021-05-26', 'Program monitoring visit of Project "Dissemination and Reinforcement of Basic Preventive Messages on COVID-19"', '', false, false, '2021/699', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 373887, NULL, NULL, 2);
