INSERT INTO [[schema]].t2f_travel VALUES (738, '2021-12-22 01:56:15.556914+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Trip Report, 24th to 26th November 2021.
Monitoring and eval[[schema]]ion is an essential part for any programme to succeed. Vaccination coverage and dropout rates are monitored widely at all levels and provide critical information on immunization performance. Process indicators help with the heavy reliance on coverage, provide prospective data, and describe the country immunization program to inform decisions that improve RI management. In line with this, a training was planned targeting SCPHNs, SCMOHs, SCHRIOs, SCDSCs, CHMT members and METs to review immunization indicators and at the same time to harmonize the immunization denominators. The activities took place as from 24th to 26th November 2021.
During the same period on the 26th of November,2021, I was able to attend a stakeholder meeting that was mainly focused on PIRI. Various issues were raised especially regarding the Covid Vaccines. Though the uptake of the vaccine has really gone high, many individuals do not have the correct information on the vaccines. Hearsay and rumors have hindered many individuals from getting the jab as explained by a Juakali representative in the meeting. He explained the need to have some simple fliers with information on Covid that could be easily shared.
   
I also had the opportunity to go around some health facilities in Kitui Central, Kitui South, Mwingi West and Mwingi Central sub counties to check on the progress of PIRI.
Observations 
1.	PIRI has started in many of the facilities with the PIRI objectives and targets well understood.
2.	Several outreaches have been conducted targeted mainly at HPV and Covid vaccines outreaches have been well taken up throughout the county. There is generally a great acceptance of the vaccines and in some instances, teachers are calling the SCPHNs requesting for the vaccine.
3.	In some facilities, I realized information on PIRI was not well cascaded to the other staff. Some did not clearly understand what PIRI was nor its objectives or targets.
4.	Weekly PIRI reporting was well done apart from 1 subcounty, Mwingi West, whose results did not reflect nationally despite them confirming they had submitted the data.
5.	Only a small percentage of the facilities visited followed the micro plans developed during the training.
6.	Most of the health facilities represented had a well elaborated communication plan that guided the facilities.
7.	Defaulter tracing was well done in all the facilities; however, some facilities did not have a defaulter tracing registers.
8.	The health care workers did give key health messages to the caregivers during each visit to the health facilities.', '', 'planned', '2021-11-25', '2021-11-26', 'To offer support in Immunization Denominator Cascade training in Kitui county as well as PIRI support supervision.', 'To offer support in Immunization Denominator Cascade training in Kitui county as well as PIRI support supervision and monitoring.', false, false, '2021/720', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, 2, 23436, 408103, NULL, NULL, 2);
