INSERT INTO [[schema]].t2f_travel VALUES (754, '2022-04-13 12:11:05.496599+00', NULL, NULL, '2022-04-13 12:12:18.046085+00', NULL, NULL, '', '', '', 'Developing a national strategic plan requires setting goals, objectives, and formulating broad activity areas, creating medium-term implementation guidance, and approving and disseminating the plan. This was the first workshop of all stakeholders and MoH structures to utilize results of the national medical oxygen landscape analysis and commence writing of the national strategy for medical oxygen scale-up.
Specific workshop Objectives 
1. To review the national medical oxygen landscape and identify the main 
bottlenecks/gaps/barriers to scaled-up access to and use of medical oxygen in Lesotho
2. Define the national strategic framework for scaling-up medical oxygen access and use 
set objectives and identify broad activity /interventions areas for removing barriers and 
address gaps in the national oxygen ecosystem 
3. Set clear inclusive next steps for writing and finalizing the national strategy and its 
implementation plan
Outputs
1. Consensus on national strategic framework for scaling access to medical oxygen [strategic goal, objectives, and interventions]
2. Clear plan for writing the strategy [modalities for continuing with an inclusive writing 
process and timelines to finalization]', '', 'submitted', '2022-04-07', '2022-04-07', 'Participate in the development of Medical Oxygen Scale up Strategy', '', false, false, '2022/736', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, 2, 81, 422911, '2022-04-13 12:12:18.046094+00', NULL, 8);
