INSERT INTO [[schema]].t2f_travel VALUES (769, '2022-06-15 13:11:04.714636+00', NULL, NULL, NULL, NULL, NULL, '', '', '', 'Barka village school in Yaseen is hosting 600 students and has ten male teachers and four female teachers only two of this number are appointed. It has one permanent class unit built by UNICEF and six classes built of local materials. UNICEF will build another class unit and construction work hasn’t started yet. UNICEF also supports 34 students with school meal and payment is made to the PTA members along with the school administration through UPO this will be used when students come back from summer vacation. The second school is Maali North where the ALP class hosts forty-five students only thirty-two students from the most vulnerable are accommodated in the school meal program. UNICEF has distributed 136400 for thirty-one students. For the second month which will be after summer vacation the same amount was given to the PTA and all was in the presence of PTA members, school administration and students’ parents. Documents were signed by PTA members for this process in both schools.', '', 'planned', '2022-06-14', '2022-06-14', 'Monitoring visit for ALP centers in Baraka village in  Yaseen locality and Maali North in Asalia locality', '', false, false, '2022/751', false, NULL, 0.0000, false, NULL, NULL, NULL, 145, NULL, NULL, 461241, NULL, NULL, 4);
